<template>
  <img ref="img" :id="finalId" :src="placeholder" :data-src="src" :alt="alt"/>
</template>

<script lang="ts">
import {defineComponent, PropType} from "vue";
import LazyLoad, {ILazyLoadInstance, ILazyLoadOptions} from "vanilla-lazyload";

export default defineComponent({
  name: "LazyLoad",
  props: {
    alt: String,
    errorImage: {
      type: String,
      default: "data:image/webp;base64,",
    },
    id: String,
    options: {
      type: Object as PropType<ILazyLoadOptions>,
      default: {},
    },
    placeholder: {
      type: String,
      default: 'data:image/webp;base64,',
    },
    src: {
      type: String,
      required: true
    },
  },
  emits: ['applied', 'cancel', 'enter', 'loadError', 'exit', 'finish', 'loaded', 'loaded', 'loading'],
  computed: {
    finalId(): string {
      return this.id ?? 'image-' + Math.random().toString(16).slice(2);
    },
    finalOptions(): ILazyLoadOptions {
      return {
        ...this.options,
        callback_applied: (el: HTMLElement) => this.$emit('applied', el),
        callback_cancel: (el: HTMLElement) => this.$emit('cancel', el),
        callback_enter: (el: HTMLElement) => this.$emit('enter', el),
        callback_error: (el: HTMLElement) => this.onLoadError(el),
        callback_exit: (el: HTMLElement) => this.$emit('exit', el),
        callback_finish: (instance: ILazyLoadInstance) => this.$emit('finish', instance),
        callback_loaded: (el: HTMLElement) => this.$emit('loaded', el),
        callback_loading: (el: HTMLElement) => this.$emit('loading', el),
        class_applied: 'lazy-applied',
        class_entered: 'lazy-entered',
        class_error: 'lazy-error',
        class_exited: 'lazy-exited',
        class_loaded: 'lazy-loaded',
        class_loading: 'lazy-loading',
      };
    },
  },
  data() {
    return {
      lazy: null as null|ILazyLoadInstance,
    }
  },
  updated() {
    this.setupLazy();
  },
  mounted() {
    this.setupLazy();
  },
  methods: {
    setupLazy() {
      if (this.lazy) {
        this.lazy.destroy();
      }
      let img = this.$refs.img as HTMLElement;
      img.classList.remove('lazy-applied');
      img.classList.remove('lazy-entered');
      img.classList.remove('lazy-error');
      img.classList.remove('lazy-exited');
      img.classList.remove('lazy-loaded');
      img.removeAttribute('data-ll-status');
      this.lazy = new LazyLoad(this.finalOptions, document.querySelectorAll(`#${this.finalId}`));
      return img;
    },
    onLoadError(el: HTMLElement) {
      console.log(el);
      this.$emit('loadError', el);
      el.setAttribute("src", this.errorImage);
    },
  }
});
</script>

